using System;
using UnityEngine;
using System.IO;
using UnityEngine.UI;

public class ImageFromCode
{
    public static Texture2D Base64ToImg(string base64String)
    {
        byte[] bytes = Convert.FromBase64String(base64String);
        Texture2D tex2D = new Texture2D(100, 100);
        tex2D.LoadImage(bytes);
        return tex2D;
    }
